        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Experience</div>
        </div>
        <div
          className="container"
          style={{
            // backgroundColor: "#F1F2F2",
            backgroundColor: "white",
            padding: "1%",
            borderRadius: "10px",
          }}
