          <div style={Content}>
            <div className="Ex" data-aos="zoom-in" style={WorkExdivs}>
              style=
              {{
                width: "150px",
                height: "150px",
                justifyContent: "space-around",
                alignItems: "center",
                display: "flex",
                flexDirection: "column",
                flexDrection: "column",
              }}
              >
              <img
                alt="companylogo"
                style={{ maxWidth: "70%", maxHeight: "70%" }}
                src={require("../Icons/Icons-05.png")}
              />
              <div
                style={{
                  fontSize: "15px",
                  color: "#193964",
                  fontWeight: "bold",
                }}
              >
                2020
              </div>
              <div className="ExpSub">
                content <br /> here <br />
                jgdnfbxfn
                <br /> ngdngd <br />
                jgfj
              </div>
            </div>
            <div className="Ex" data-aos="zoom-in" style={WorkExdivs}>
              <div style={{ width: "100px", height: "100px" }}>
                <img
                  alt="companylogo"
                  style={{ maxWidth: "80%", maxHeight: "80%" }}
                  src={require("../Icons/Icons-06.png")}
                />
              </div>
              <div className="ExpSub">
                content <br /> here <br />
                jgdnfbxfn
                <br /> ngdngd <br />
                jgfj
              </div>
            </div>
            <div
              className="Ex"
              data-aos="zoom-in"
              style={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <div style={{ width: "100px", height: "100px" }}>
                <img
                  alt="companylogo"
                  style={{ maxWidth: "80%", maxHeight: "80%" }}
                  src={require("../Icons/Icons-07.png")}
                />
              </div>
              <div className="ExpSub">
                content <br /> here <br />
                jgdnfbxfn
                <br /> ngdngd <br />
                jgfj
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const MainDiv = {
  marginTop: "70px",
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

const Content = {
  fontSize: "25px",
  color: "black",
};

const WorkExdivs = {
  padding: "5%",
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  justifyContent: "center",
  borderBottom: "1px solid #ffd56f",
};
export default ExperienceResp;
